import React from 'react';
import { useState, useEffect } from "react";
import cardData from "../../card.json";
import { NavLink } from 'react-router-dom';
import { Intro } from 'intro'
/**
* @author
* @function Cardlist
**/

const Cardlist = (props) => {
    let urlPath = "developer/en/api/dummy1";
  return(
    <div className="container">Cardlist
        <div className="row">
            {cardData.map((cardList,index) => {
                return <div className="col-4">
                    <h4>{cardList.title}</h4>
                    <p>{cardList.description}</p>
                    <NavLink to='en/api/dummy1/intro' component={Intro}><p className="intro">{cardList.intro}</p></NavLink>
                    <a className="guid">{cardList.guid}</a>
                    <a className="intro">{cardList.ref}</a>
                    </div>
            })}
        </div>
    </div>
   );
 }


export default Cardlist
